import Logo from '@/components/Logo';
import { ArrowRightCircleIcon, ZapIcon, CodeIcon, MoonIcon, SearchIcon } from 'vue-feather-icons';
export default {
  components: {
    Logo: Logo,
    ArrowRightCircleIcon: ArrowRightCircleIcon,
    ZapIcon: ZapIcon,
    CodeIcon: CodeIcon,
    MoonIcon: MoonIcon,
    SearchIcon: SearchIcon
  },
  metaInfo: function metaInfo() {
    var title = 'Great Documentation starts here';
    var description = 'DOCC is a starter theme with instant search and dark mode for writing great technical documentation. Based on Gridsome!';
    return {
      title: title,
      meta: [{
        name: 'description',
        content: description
      }, {
        key: 'og:title',
        name: 'og:title',
        content: title
      }, {
        key: 'twitter:title',
        name: 'twitter:title',
        content: title
      }, {
        key: 'og:description',
        name: 'og:description',
        content: description
      }, {
        key: 'twitter:description',
        name: 'twitter:description',
        content: description
      }]
    };
  }
};
